When it comes to vision correction, there’s no such thing as a one-size-fits-all solution. As a top ophthalmologist in NYC, I take a fully customized approach to every patient’s eyes, because your vision deserves nothing less. Whether it’s LASIK, SMILE, PRK, or more advanced procedures like EVO ICL or RLE, your treatment plan is tailored to your unique needs, goals, and eye anatomy. Safety is always my top priority, and I use the latest premium diagnostic and surgical technology to deliver precise, effective results. Paired with concierge-level care, the entire experience is designed to be as smooth, informative, and personalized as possible.

